(function(){"use strict";window.submitConfigForm=function(form,makeValue){if(!form.hasClass("init-ajax-callback")){form.addClass("init-ajax-callback");form.on("ajax-error",function(_e,_u,type,msg){swal(type,msg.message,"error")});form.on("ajax-success",function(_e,data){if(data.error){swal("확인",data.errorMsg,"error")}})}if(_.isUndefined(makeValue)||_.isNull(makeValue)){makeValue=function(json){return JSON.stringify(json)}}if(form.parsley().isValid()){const json=_.omit(form.serializeObject(),["act","_out","inst","room","key","jsonValue"]);console.log(json);form.find('input[name="jsonValue"]').val(makeValue(json));console.log(form.find('input[name="jsonValue"]').val());form.submit()}}})(jQuery);